package designProblems.cache;

public class Cachedata {

    private String key;
    private String value;

    public String getKey(){
        return this.key;
    }

    public String getValue(){
        return this.value;
    }

    public void setKey(String key){
        this.key = key;
    }

    public void setValue(String value){
        this.value = value;
    }


}
